import React from "react";
import ReactDOM from "react-dom";
import Cards from "./Cards";
import Sdata from "./SData";
import './index.css';

ReactDOM.render(
    <>
    <h1>Most viewewd seasons in 2022</h1>
     {Sdata.map((val)=>{         
    return(    <Cards
        key = {val.id}
        imgsrc={val.imgsrc}
        title={val.title}
        SName={val.SName}
        refrence={val.refrence}
        />);

     })}

        {console.log(Sdata)}
    </>
    ,
    document.getElementById("root"));
